History Documentary hosted by Dorian Lough, published by Channel 5 in 2014 - English narration


Information
------------------------------

The Jersey Slayer: Family Massacre
Documentary about Damian Rzeszowski, who killed six people in a frenzied attack at a barbecue at his family home in Jersey in 2011. Witnesses, the investigating officers and friends of the victims give their views on the 31-year-old Polish builder and what happened that day. The film also delves into his background and psyche.

